import React, { useState } from 'react';
import styled from 'styled-components';
import Friend from './Friend';

const FriendsListContainer = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  flex-direction: column;
  width: 22%;
`;
const FriendsListTitle = styled.div`
  width: 50%;
  background: blue;
  color: white;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 7px;
  border-radius: 10px;
`;
const FriendsListBlock = styled.div`
  width: 100%;
  height: 580px;
  border: 2px solid #73b2ff;
  padding: 10px;
  border-radius: 10px;
  overflow-y: auto;
`;

const friendsList = [
  {
    profileImage: '1646621980718.jpeg',
    nickname: '123',
  },
  { profileImage: '1646702364540.jpeg', nickname: 'nani' },
  { nickname: 'abcd' },
];

const FriendsList = () => {
  return (
    <FriendsListContainer>
      <FriendsListTitle>친구 목록</FriendsListTitle>
      <FriendsListBlock>
        {friendsList.map(({ profileImage, nickname }) => (
          <Friend
            key={nickname}
            profileImage={profileImage}
            nickname={nickname}
          />
        ))}
      </FriendsListBlock>
    </FriendsListContainer>
  );
};

export default FriendsList;
